    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then                                 U.S. Census Bureau's Master Address File
    / Topologically Integrated Geographic Encoding and Referencing (MAF/TIGER) Database
    (MTDB).n                                 The MTDB represents a seamless national
    file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
    is designed ton                                 stand alone as an independent data
    set, or they can be combined to cover the entire nation.nn                                 Census
    tracts are small, relatively permanent statistical subdivisions of a county or equivalent
    entity, and were defined by localn                                 participants
    as part of the 2010 Census Participant Statistical Areas Program.  The Census Bureau
    delineated the census tracts inn                                 situations where
    no local participant existed or where all the potential participants declined to
    participate.  The primary purpose ofn                                 census tracts
    is to provide a stable set of geographic units for the presentation of census data
    and comparison back to previousn                                 decennial censuses.
     Census tracts generally have a population size between 1,200 and 8,000 people,
    with an optimum size of 4,000n                                 people.  When first
    delineated, census tracts were designed to be homogeneous with respect to population
    characteristics, economicn                                 status, and living conditions.
     The spatial size of census tracts varies widely depending on the density of settlement.
     Physicaln                                 changes in street patterns caused by
    highway construction, new development, and so forth, may require boundary revisions.
     In addition,n                                 census tracts occasionally are split
    due to population growth, or combined as a result of substantial population decline.
     Census tractn                                 boundaries generally follow visible
    and identifiable features.  They may follow legal boundaries such as minor civil
    division (MCD) orn                                 incorporated place boundaries
    in some States and situations to allow for census tract-to-governmental unit relationships
    where then                                 governmental boundaries tend to remain
    unchanged between censuses.  State and county boundaries always are census tract
    boundaries inn                                 the standard census geographic hierarchy.
     In a few rare instances, a census tract may consist of noncontiguous areas.  Thesen
                                    noncontiguous areas may occur where the census
    tracts are coextensive with all or parts of legal entities that are themselvesn
                                    noncontiguous.  For the 2010 Census, the census
    tract code range of 9400 through 9499 was enforced for census tracts that include
    an                                 majority American Indian population according
    to Census 2000 data and/or their area was primarily covered by federally recognized
    n                                 American Indian reservations and/or off-reservation
    trust lands; the code range 9800 through 9899 was enforced for those census tractsn
                                    that contained little or no population and represented
    a relatively large special land use area such as a National Park, militaryn                                 installation,
    or a business/industrial park; and the code range 9900 through 9998 was enforced
    for those census tracts that containedn                                 only water
